import menuPic from "./menuPic.png";
import "./menu.css";

function Menu() {
  return (
    <div className="rows">
      <img src={menuPic} alt="Menu" className="Menu"></img>
      <div className="menuStatement">
        <div>Check out out latest menu</div>
        <div>Serving fresh brews brunches, and samdwiches</div>
      </div>
    </div>
  );
}

export default Menu;
